            <div class=""project-content"">
                <div class=""row"">
                    <h1>Состав астероидного вещества</h1>

                    <p>Метеориты крайне разнообразны, как разнообразны и их родительские тела - астероиды. В то же время поражает убогость их минералогического состава. Метеориты состоят, в основном, из железо-магнезиальных силикатов - оливинов и пироксенов разного состава, от почти чистого фаялита и ферросилита, не содержащих магния, до почти чистого форстерита и энстанита, не содержащих железа.</p>

                    <p>Они присутствуют в виде мелких кристалликов или в виде стекла, обычно частично перекристаллизованного. Другой основной компонент - никелистое железо, которое представляет собой твердый раствор никеля в железе, и, как в любом растворе, содержание никеля в железе бывает различно - от 6-7% до 30-50%. Изредка встречается и б");
            WriteLiteral(@"езникелистое железо.</p>

                    <p>Иногда в значительных количествах присутствуют сульфиды железа. Прочие же минералы находятся в малых количествах. Удалось выявить всего около 150 минералов, и, хотя даже теперь открывают все новые и новые, ясно, что число минералов метеоритов очень мало по стравнению с обилием их в горных породах Земли, где их выявлено более 1000. Это свидетельствует о примитивном, неразвитом характере метеоритного вещества. Многие минералы присутствуют не во всех метеоритах, а лишь в некоторых из них.</p>

                    <p>Наиболее распространены среди метеоритов хондриты. Это каменные метеориты от светлосерой до очень темной окраски с удивительной структурой : они содержат округлые зерна - хондры, иногда хорошо видимые на поверхности разлома и легко выкрашивающиеся из метеорита. Размеры хондр различны - от микроскопических до сантиметровых. Они занимают значительный объем метеорита, иногда до половины его, и слабо сцементированы междхондровым веществомматрицей.</p>");
            WriteLiteral(@"

                    <p>Состав матрицы бывает идентичен с составом хондр, а иногда и отличается от него. В межхондровом веществе нередко находят разбитые хондры и их обломки. Такая структура присуща только метеоритам (причем многим из них !) и не встречается больше нигде. Сложенные, в основном, железо-магнезиальными силикатами, хондриты содержат и мелкодисперсное никелистое железо, сульфиды и другие минералы.</p>

                    <p>По поводу происхождения хондр существует много гипотез, но все они спорные. Короче говоря, происхождение хондр до сих пор не известно. Различают HH, H, L и LL-хондриты с очень высоким, низким и очень низким содержанием свободного металлического железа. Соответственно, при переходе от одного класса к другому убывает и общее содержание железа (свободного и входящего в силикаты). Кроме того, выделяют группу E-хондритов, в которых почти все железл находится в свободном состоянии, так что силикатам достается почти один магний, а также группу углистых С-хондритов, в которых очен");
            WriteLiteral("ь мало железа, но почти все оно находится в силикатах.</p>\r\n\r\n                </div>\r\n            </div>\r\n\r\n        </div>\r\n    </section>\r\n</div>\r\n\r\n");
